import React from "react";
import { Link } from "react-router-dom";

function ButtonOptionMenu(props) {
  return (
    <li>
      <a href={props.href} onClick={props.toggleMenu}>
        {props.icon} {props.name}
      </a>
    </li>
  );
}

export default ButtonOptionMenu;
